import { Input, OutlinedInput } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  buttonSubmit: {
    marginBottom: 10,
    color: "white",
    backgroundColor: "#D74040",
  },
  // Input:{
  //   variant="outlined",
  // }
}));
